import React, { Component } from 'react';
import './titre5.css';

class Titre5 extends Component {
  render() {
    const titre5 = this.props.titre5;

    return (
      <div className="title5">
        <p>{titre5}</p>
      </div>
    );
  }
}

export default Titre5;
